const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <h2 {...{
      "id": "canceling-your-subscription"
    }}>{`Canceling Your Subscription`}</h2>
    <p>{`You can cancel your subscription plan at any time from the `}<strong parentName="p">{`Team Management`}</strong>{` page.`}</p>
    <p><strong parentName="p">{`NOTE:`}</strong>{` If you want to cancel an Enterprise plan, contact your Sauce Labs account executive.  `}</p>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`In Sauce Labs, click `}<strong parentName="p">{`Account`}</strong>{` and then click `}<strong parentName="p">{`Team Management`}</strong>{`.`}</p>
        <img src={useBaseUrl('img/team-mgmt/team-mgmt-nav.jpg')} alt="Team management navigation" width="400" />
      </li>
      <li parentName="ol">
        <p parentName="li">{`Next to your plan description on the `}<strong parentName="p">{`Team Management`}</strong>{` page, click `}<strong parentName="p">{`Manage`}</strong>{`.`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`Click the `}<strong parentName="p">{`Cancel Subscription`}</strong>{` link at the bottom of the `}<strong parentName="p">{`Plan Details`}</strong>{` page.`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`Click `}<strong parentName="p">{`Yes`}</strong>{` in the confirmation dialog to cancel your plan.`}</p>
      </li>
    </ol>
    <h2 {...{
      "id": "upgrading-your-subscription"
    }}>{`Upgrading Your Subscription`}</h2>
    <p>{`If you need more concurrent VMs, concurrent devices, or more minutes, you can upgrade your subscription plan on the `}<strong parentName="p">{`Team Management`}</strong>{` page. You can also enter redemption codes for upgrades and free minutes on the same page.`}</p>
    <p><strong parentName="p">{`NOTE:`}</strong>{` If you want to upgrade an Enterprise plan, contact your Sauce Labs account executive.`}</p>
    <ol>
      <li parentName="ol">{`In Sauce Labs, click `}<strong parentName="li">{`Account`}</strong>{` and then click `}<strong parentName="li">{`Team Management`}</strong>{`.`}</li>
      <li parentName="ol">{`Next to your plan name, click `}<strong parentName="li">{`View Details`}</strong>{`.`}</li>
      <li parentName="ol">{`Click `}<strong parentName="li">{`Upgrade Plan`}</strong>{` and choose the new plan details.`}</li>
    </ol>
    </MDXLayout>;
}

